import './App.css';

import React, { Component } from 'react'
import Navbar from './component/Navbar';
import News from './component/News';
import { BrowserRouter, Routes, Route, Router, Switch } from "react-router-dom";
export default class App extends Component {
  render() {
    return (
      <div>


       <BrowserRouter>
      <Routes>
       <Navbar/>

          <Route path="/business"element={<business />} ><News pagesize={8} country="in" category="business"/></Route>
          <Route path="/entertainment" element={<entertainment />} ><News pagesize={8} country="in" category="entertainment"/></Route>
          <Route path="/general" element={<general />} ><News pagesize={8} country="in" category="general"/></Route>
          <Route path="/health" element={<health />} ><News pagesize={8} country="in" category="health"/></Route>
          <Route path="/science" element={<science />} ><News pagesize={8} country="in" category="science"/></Route>
          <Route path="/sports" element={<sports />} ><News pagesize={8} country="in" category="sports"/></Route>
          <Route path="/technology" element={<technology />} ><News pagesize={8} country="in" category="technology"/></Route>
          </Routes>
    </BrowserRouter>
      </div>
    )
  }
}
